import { getData } from "../services/dataService";
export default function ShowData()
{
    const [bids,setBids]=useState("");
    const [asks,setAsks]=useState("");
    useEffect(()=>{
        async function fetchData()
        {try
            {
                const res =await getData();
                console.log(res)
                setBids(res["bids"]);
                setAsks(res["asks"]);
                debugger;
                console.log(bids);
                console.log(asks);
            }
            catch(e)
            {
                setData([]);
            }
            

        }     
     fetchData();
    },[])
    return(
     <div>
       {bids,
       asks}
     </div>
    )
}
